import React from 'react';

const initialState = 0;

const reducer = (state, action) => {

  if (action.type === 'INC') {
    return state + 1;
  }

  return 0;
}

let state = reducer( initialState, {type: 'INC'} )
let state1 = reducer( initialState, {type: 'INC'} )

function App() {
  return (
    <div>
     {state}
     {state}
    </div>
  );
}

export default App;
